INSERT INTO `diccionario` (`id`, `prefijo`, `nombre`, `orden`, `rutina`, `iduser`) VALUES
	(1, 'public', 'centros', 1, 'drop table IF EXISTS `public_centros`;\r\nCREATE TABLE `public_centros` (\r\n  `codcen` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `codsoc` varchar(2) CHARACTER SET utf8 NOT NULL,\r\n  `nomcen` varchar(35) CHARACTER SET utf8 DEFAULT NULL,\r\n  `descricen` longtext CHARACTER SET utf8\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_centros`\r\n  ADD PRIMARY KEY (`codcen`);', 1),
	(2, 'public', 'sociedades', 2, '\r\nDROP TABLE IF EXISTS `public_sociedades`;\r\nCREATE TABLE `public_sociedades` (\r\n  `socio` varchar(1) CHARACTER SET utf8 NOT NULL,\r\n  `dsocio` varchar(40) CHARACTER SET utf8 NOT NULL,\r\n  `rucsoc` varchar(12) CHARACTER SET utf8 NOT NULL,\r\n `activo` char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT \'1\',\r\n  `id` int(11) NOT NULL,\r\n  `direccionfiscal` varchar(60) COLLATE utf8_unicode_ci NOT NULL,\r\n  `telefono` varchar(25) COLLATE utf8_unicode_ci NOT NULL,\r\n  `web` varchar(35) COLLATE utf8_unicode_ci NOT NULL,\r\n  `mail` varchar(40) COLLATE utf8_unicode_ci NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\r\n\r\n\r\nALTER TABLE `public_sociedades`\r\n  ADD PRIMARY KEY (`id`), \r\n  ADD UNIQUE KEY `socio` (`socio`), \r\n  ADD UNIQUE KEY `unique_rucsoc` (`rucsoc`), \r\n  ADD KEY `i_socio` (`socio`), \r\n  ADD KEY `rucsoc` (`rucsoc`);\r\n\r\n\r\nALTER TABLE `public_sociedades`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 1),
