	(52, 'public', 'coordocs', 95, 'DROP TABLE IF EXISTS `public_coordocs`;\r\nCREATE TABLE IF NOT EXISTS `public_coordocs` (\r\n	`id` INT(11) NOT NULL AUTO_INCREMENT,\r\n  `xgeneral` int(5) NOT NULL,\r\n  `ygeneral` int(5) NOT NULL,\r\n  `xlogo` int(5) NOT NULL,\r\n  `ylogo` int(11) NOT NULL,\r\n  `codocu` char(3) COLLATE utf8_general_ci NOT NULL,\r\n  `codcen` char(4) COLLATE utf8_general_ci NOT NULL,\r\n  `modelo` varchar(40) COLLATE utf8_general_ci NOT NULL,\r\n  `nombrereporte` varchar(40) COLLATE utf8_general_ci NOT NULL,\r\n  `detalle` text COLLATE utf8_general_ci NOT NULL,\r\n  `campofiltro` varchar(30) COLLATE utf8_general_ci NOT NULL,\r\n  `tamanopapel` varchar(20) COLLATE utf8_general_ci NOT NULL,\r\n  `x_grilla` int(11) NOT NULL,\r\n  `y_grilla` int(11) NOT NULL,\r\n  `registrosporpagina` int(11) NOT NULL,\r\n  `estilo` varchar(25) COLLATE utf8_general_ci NOT NULL,\r\n  `tienepie` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `tienelogo` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `sociedad` int(11) NOT NULL,\r\n  `campoestado` varchar(30) COLLATE utf8_general_ci NOT NULL,\r\n  `xresumen` int(11) NOT NULL,\r\n  `yresumen` int(11) DEFAULT NULL,\r\n  `campototal` varchar(30) CHARACTER SET utf8 NOT NULL,\r\n  `comercial` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `tienecabecera` char(1) COLLATE utf8_general_ci NOT NULL\r\n) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\nINSERT INTO `public_coordocs` (`id`, `xgeneral`, `ygeneral`, `xlogo`, `ylogo`, `codocu`, `codcen`, `modelo`, `nombrereporte`, `detalle`, `campofiltro`, `tamanopapel`, `x_grilla`, `y_grilla`, `registrosporpagina`, `estilo`, `tienepie`, `tienelogo`, `sociedad`, `campoestado`, `xresumen`, `yresumen`, `campototal`, `comercial`, `tienecabecera`) VALUES\r\n(3, 0, 0, 1, 1, \'101\', \'1302\', \'VwAlmacendocs\', \'VALE DE ALMACEN\', \'Reporta el vale de almacen para un centro especifico,  las coordenadas Xgeneral, Ygeneral\\r\\nXolog, Ylogo, son para definir las posiciones del inicio del contenido en el papel, de manera independiente de cada centro logistico. Esto para evitar los margenes indeseados producto de los saltos de las impresoras.  La propiedad tamao define el tamaio del papel.  El modelo es el nombre de la fuente de datos de la BD.\', \'idvale\', \'A5-L\', 50, 170, 9, \'estilooc.css\', \'1\', \'1\', 1, \'cestadovale\', 0, 0, \'\', \'0\', \'\'),\r\n(7, 10, 10, 4, 4, \'100\', \'1504\', \'VwGuia\', \'GUIA REMISION\', \'\', \'id\', \'A4\', 60, 300, 20, \'estiloguia.css\', \'1\', \'1\', 1, \'\', 0, 0, \'\', \'\', \'\'),\r\n(8, 0, 0, 5, 5, \'210\', \'1504\', \'VwOcompra\', \'ORDEN DE COMPRA\', \'Reporte de orden de comprax\', \'idguia\', \'A4\', 100, 350, 30, \'estilooc.css\', \'1\', \'1\', 1, \'estadodetalle\', 400, 700, \'totalneto\', \'1\', \'\'),\r\n(9, 0, 0, 0, 0, \'200\', \'1302\', \'VwRendiciontrabajador\', \'RENDICION CAJA MENOR TRABAJADOR\', \'Reporte que muestra la rendicion de caja chica de un trabajador \', \'id\', \'A5-L\', 50, 170, 10, \'estiloguia.css\', \'1\', \'1\', 1, \'codestado\', 600, 900, \'\', \'0\', \'\'),\r\n(10, 0, -90, 0, 0, \'100\', \'1302\', \'VwGuia\', \'GUIA GIORGIO PAPEL NORMAL\', \'Reporte diseado para pruebas en Giorgio Razzo\', \'id\', \'A4\', 70, 290, 25, \'estiloguia.css\', \'0\', \'0\', 1, \'\', 0, NULL, \'\', \'0\', \'\');\r\n\r\n\r\nALTER TABLE `public_coordocs`\r\n  ADD PRIMARY KEY (`id`), ADD KEY `fk_coordocu` (`codocu`);', 1),
