u` (`codocu`), ADD KEY `fk_coordreport` (`hidreporte`), ADD KEY `hidcoordocs` (`hidcoordocs`);\r\n\r\n\r\nALTER TABLE `public_coordreporte`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1,\r\n  add foreign key (`codocu`) REFERENCES  public_documentos (`coddocu`);', 1),
