	(55, 'public', 'cargamasiva', 99, 'DROP TABLE IF EXISTS `public_cargamasiva`;\r\nCREATE TABLE IF NOT EXISTS `public_cargamasiva` (\r\n  `id` int(11) NOT NULL,\r\n  `modelo` varchar(60) COLLATE utf8_general_ci NOT NULL,\r\n  `iduser` int(11) NOT NULL,\r\n  `fechacreac` date NOT NULL,\r\n  `fechaejec` date NOT NULL,\r\n  `insercion` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `descripcion` varchar(60) COLLATE utf8_general_ci NOT NULL,\r\n  `escenario` varchar(60) COLLATE utf8_general_ci NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\nINSERT INTO `public_cargamasiva` (`id`, `modelo`, `iduser`, `fechacreac`, `fechaejec`, `insercion`, `descripcion`, `escenario`) VALUES\r\n(1, \'Alinventario\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'Actualizar inventario AF\', \'update\'),\r\n(2, \'Alinventario\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'ACTUALIZACION MASIVA DE INVENTARIO\', \'cargamasiva\'),\r\n(3, \'Inventario\', 1, \'0000-00-00\', \'0000-00-00\', \'1\', \'INSERTAR INVNETARIO\', \'BATCH_INS_BASICO\'),\r\n(5, \'Clipro\', 1, \'0000-00-00\', \'0000-00-00\', \'1\', \'CREAR PROVEEDORES\', \'BATCH_INS\'),\r\n(6, \'Direcciones\', 1, \'0000-00-00\', \'0000-00-00\', \'1\', \'CREAR DIRECCIONES\', \'BATCH_INS\'),\r\n(7, \'Alinventario\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'ACTUALIZAR INVENTARIO MATERIALES\', \'cargamasiva\'),\r\n(8, \'Inventario\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'carga masiva \', \'BATCH_INS_BASICO\'),\r\n(9, \'Clipro\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'CARGA MASIVA DE PROVEEDORES\', \'BATCH_INS\'),\r\n(10, \'Clipro\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'CARGA MASIVA DE PROVEEDORES\', \'BATCH_INS\'),\r\n(11, \'Clipro\', 1, \'0000-00-00\', \'0000-00-00\', \'0\', \'CARGA MASIVA DE PROVEEDORES\', \'BATCH_INS\'),\r\n(12, \'Clipro\', 1, \'0000-00-00\', \'0000-00-00\', \'1\', \'CARGA MASIVA DE PROVEEDORES\', \'BATCH_INS\'),\r\n(13, \'Clipro\', 1, \'0000-00-00\', \'0000-