INSERT INTO `public_noticias` (`id`, `txtnoticia`, `fecha`, `autor`, `expira`, `tiponoticia`, `mensaje`, `aprobado`, `fechapublicacion`, `fechapropuesta`, `fexpira`, `iduser`) VALUES
	(2, 'Feliz cumpleaos , el dia de hoy  :  JULIAN RAMIREZ  TENORIO   AVELINO SANDOVAL GUZMAN   \nMuchas felicidades en este dia ....!', '2016-04-13 07:32:56', 'admin', NULL, '02', NULL, 1, '2016-04-13 07:32:56', '2016-04-13', '2016-09-13', 1),
	(3, 'Se comunica a todo el personal que el acceso al patio N2 est restringido por labores de mantenimineto. Los trabajos se efectuaran durante todo el dia, proxima culminacin la proxima semana.', '2016-04-15 23:29:44', 'admin', NULL, '02', NULL, 1, '2016-04-15 23:40:05', '2016-04-15', '2016-09-15', 1),
	(4, 'Se ha extraviado una billetera de color marron en los inmediaciones del taller ', '2016-05-04 18:53:12', 'admin', NULL, '01', NULL, 1, '2016-05-04 18:53:33', '2016-05-06', '2016-09-04', 1),
	(5, ' los interesados, este verano se han programado 2 visitas a las playas de Coln. El costo por persona es de S/. 50.00. Las salidas este Viernes 17 a las 5:00pm. Inscripciones en la oficina de', '2016-05-16 09:51:38', 'admin', NULL, '01', NULL, 1, '2016-05-16 09:51:48', '2016-05-16', '2017-03-11', 1),
	(6, 'Se les comunica a los estimados trabajadores que revisen su estado de retenciones de 5ta Categora, mes a mes.  SUNAT ha indicado que es responsabilidad de cada trabajador la validacin de la retencion de la misma. EVITE MULTAS y exija su boleta de pago. En caso de liquidacion, se emitira un certificado de retenciones.', '2016-05-16 09:54:27', 'admin', NULL, '01', NULL, 1, '2016-05-16 09:54:37', '2016-05-16', '2017-07-21', 1),
	(7, 'Se ha extraviado una billetera del Sr JESUS ORDOEZ, en la inmediaciones de la planta. En caso de haberlo encontrado favor de devolverla al rea de RRHH. Esta billetera contiene documentos muy importantes para esta persona y se ruega devolverlos', '2016-05-16 09:55:39', 'admin', NULL, '01', NULL, 1, '2016-05-16 09:55:50', '2016-05-09', '2017-05-26', 1);
